op up alert message |\r\n\r\n  @Arraytag5\r\n  Scenario: Navigate to \"Practice Questions\" page for Arrays in Python\r\n    Given The user is on the tryEditor window in Arrays page\r\n    When The user clicks Practice Questions button following browser back arrow\r\n    Then The user should be directed to Array practice question page\r\n\r\n  @Arraytag6\r\n  Scenario Outline: Navigate to \"Search the Array\" question from Practice Questions page\r\n    Given The user is in the Practice Questions of array page\r\n    When The user clicks on \"<linktext>\" link\r\n    Then The user should be redirected to \"<questionPage>\" for \"<linktext>\" page\r\n\r\n    Examples: \r\n      | linktext                                | questionPage |\r\n      | search the array                        | question\/1   |\r\n      | max consecutive ones                    | question\/2   |\r\n      | find numbers with even number of digits | question\/3   |\r\n      | squares of a sorted array               | question\/4   |\r\n\r\n  @Arraytag7\r\n  Scenario Outline: Validating \"Search the Array\"  practice question editor Functionality\r\n    Given The user is on \"<PracticeQue>\" the Practice page after clicks on arraysubpage link\r\n    When The user enters the <code> in \"<PracticeQue>\" practice page\r\n    Then The <message> for \"<code>\" should be displayed for \"<PracticeQue>\" page after click on RUN and Submit button\r\n\r\n    Examples: \r\n      | PracticeQue                             | code         | message               |\r\n      | search the array                        | Valid code   | Output in the console |\r\n      | search the array                        | Invalid code | Bad Input error msg   |\r\n      | max consecutive ones                    | Valid code   | Output in the console |\r\n      | max consecutive ones                    | Invalid code | Bad Input error msg   |\r\n      | find numbers with even number of digits | Valid code   | Output in the con logged in\"\r\n\r\n  @home4\r\n  Scenario: Verify that user able to see warning message while selecting Linked List from the drop down without Sign in.\r\n    Given The user is on the Home page\r\n    When The user selects Linked List from the drop down without Sign in.\r\n    Then The user should able to see an warning message \"You are not logged in\"\r\n\r\n  @home5\r\n  Scenario: Verify that user able to see warning message while selecting Stack from the drop down without Sign in.\r\n    Given The user is on the Home page\r\n    When The user selects Stack from the drop down without Sign in.\r\n    Then The user should able to see an warning message \"You are not logged in\"\r\n\r\n  @home6\r\n  Scenario: Verify that user able to see warning message while selecting Queue from the drop down without Sign in.\r\n    Given The user is on the Home page\r\n    When The user selects Queue from the drop down without Sign in.\r\n    Then The user should able to see an warning message \"You are not logged in\"\r\n\r\n  @home7\r\n  Scenario: Verify that user able to see warning message while selecting Tree from the drop down without Sign in.\r\n    Given The user is on the Home page\r\n    When The user selects Tree from the drop down without Sign in.\r\n    Then The user should able to see an warning message \"You are not logged in\"\r\n\r\n  @home8\r\n  Scenario: Verify that user able to see warning message while selecting Graph from the drop down without Sign in.\r\n    Given The user is on the Home page\r\n    When The user selects Graph from the drop down without Sign in.\r\n    Then The user should able to see an warning message \"You are not logged in\"\r\n\r\n  @home9\r\n  Scenario: Verify that user able to land on Array page  while selecting Array from the drop down after Log in\r\n    Given The user is on the Home page\r\n    When The user selects Array from the drop down after Log in.\r\n    Then The user should be redirected to Array page\r\n\r\n  @home10\r\n  Scenario: Verify that user able to land on Linked List page  while selecting Linked List from the drop down after Log in\r\n    Given The user is on the Home page\r\n    When The user selects Linked List from the drop down after Log in.\r\n    Then The user should be redirected to Linked List page\r\n\r\n  @home11\r\n  Scenario: Verify that user able to land on Stack page  while selecting Stack from the drop down after Log in\r\n    Given The user is on the Home page\r\n    When The user selects Stack from the drop down after Log in.\r\n    Then The user should be redirected to Stack page\r\n\r\n  @home12\r\n  Scenario: Verify that user able to land on Queue page  while selecting Queue from the drop down after Log in\r\n    Given The user is on the Home page\r\n    When The user selects Queue from the drop down after Log in.\r\n    Then The user should be redirected to Queue page\r\n\r\n  @home13\r\n  Scenario: Verify that user able to land on Tree page  while selecting Tree from the drop down after Log in\r\n    Given The user is on the Home page\r\n    When The user selects Tree from the drop down after Log in.\r\n    Then The user should be redirected to Tree page\r\n\r\n  @home14\r\n  Scenario: Verify that user able to land on Graph page  while selecting Graph from the drop down after Log in\r\n    Given The user is on the Home page\r\n    When The user selects Graph from the drop down after Log in.\r\n    Then The user should be redirected to Graph page\r\n\r\n  @home15\r\n  Scenario: Verify that user able to see warning message on clicking Get Started buttons of Data Structures-Introduction on the home page without Sign in\r\n    Given The user is on the Home page\r\n    When The user clicks Get Started buttons of Data Structures-Introduction on the homepage without Sign in\r\n    Then The user should able to see an warning message \"You are not logged in\"\r\n\r\n  @home16\r\n  Scenario: Verify that user able to see warning message on clicking Get Started but mepage without Sign in\r\n    Then The user should able to see an warning message \"You are not logged in\"\r\n\r\n  @home22\r\n  Scenario: Verify that user able to land on Data Structures-Introduction page while clicking Get Started buttons of Data Structures-Introduction on the home page during Log in\r\n    Given The user is on the Home page\r\n    When The user clicks Get Started buttons of Data Structures-Introduction on the homepage while Log in\r\n    Then The user should be redirected to Data Structures page\r\n\r\n  @home23\r\n  Scenario: Verify that user able to land on Array page while clickingGet Started buttons of Array on the home page during Log in\r\n    Given The user is on the Home page\r\n    When The user clicks Get Started buttons of Array on the homepage while Log in\r\n    Then The user should be redirected to Array page\r\n\r\n  @home24\r\n  Scenario: Verify that user able to land on Linked List page while clickingGet Started buttons of Linked List on the home page during Log in\r\n    Given The user is on the Home page\r\n    When The user clicks Get Started buttons of Linked List on the homepage while Log in\r\n    Then The user should be redirected to Linked List page\r\n\r\n  @home25\r\n  Scenario: Verify that user able to land on Stack page while clickingGet Started buttons of Stack on the home page during Log in\r\n    Given The user is on the Home page\r\n    When The user clicks Get Started buttons of Stack on the homepage while Log in\r\n    Then The user should be redirected to Stack page\r\n\r\n  @home26\r\n  Scenario: Verify that user able to land on Queue page while clickingGet Started buttons of Queue on the home page during Log in\r\n    Given The user is on the Home page\r\n    When The user clicks Get Started buttons of Queue on the homepage while Log in\r\n    Then The user should be redirected to Queue page\r\n\r\n  @home27\r\n  Scenario: Verify that user able to land on Tree page while clickingGet Started buttons of Tree o r page for Implementation of Queue in Python page\r\n    Given The user is on the Implementation of Queue in Python page\r\n    When The user clicks Try Here>>> button\r\n    Then Navigate to try Editor window with a Run button to test\r\n\r\n  @Queue4\r\n  Scenario Outline: Verify TryEditor functionality for  Implementation of Queue in Python page\r\n    Given The user is on the tryEditor window in queue page\r\n    When The user enters the <code> in text editor and clicks RUN Button\r\n    Then The <alert> should be displayed\r\n\r\n    Examples: \r\n      | code         | alert                          |\r\n      | Empty        | Error message in alert window  |\r\n      | Valid code   | displayed in the console       |\r\n      | Invalid code | nameerror pop up alert message |\r\n\r\n  @Queue5\r\n  Scenario: Verify that user is able to navigate to \"Practice Questions\" Page for \"Implementation of Queue in Python\" page\r\n    Given The user is on the tryEditor window in queue page\r\n    When The user clicks Practice Questions button following browser back arrow\r\n    Then The user is navigated to Practice Questions page\r\n\r\n  @Queue6\r\n  Scenario: Verify that user is able to navigate to \"Queue\" data structure page\r\n    Given The user is in the blank Practice page\r\n    When The user select Queue item from the drop down menu\r\n    Then The user is redirected to Queue Data Structure Page\r\n\r\n  @Queue7\r\n  Scenario: Verify that user is able to navigate to \"Implementation using collections.deque\" page\r\n    Given The user is in the Queue page after Sign in\r\n    When The user clicks Implementation using collections.deque button\r\n    Then The user should be redirected to Implementation using collections.deque page\r\n\r\n  @Queue8\r\n  Scenario: Verify that user is able to navigate to \"try Editor\" page for \"Implementation using collections.deque\" page\r\n    Given The user is on the Implementation using collections.deque page\r\n    When The user clicks Try Here>>> button\r\n    Then Navigate to try Editor window with a Run button to test\r\n\r\n  @Queue9\r\n  Scenario Outline: Verify TryEditor functionality for  \"Implementation using collections.deque\" page\r\n    Given The user is on the tryEditor window in queue page\r\n    When The user enters the <code> in text editor and clicks RUN Button\r\n    Then The <alert> should be displayed\r\n\r\n    Examples: \r\n      | code         | alert                          |\r\n      | Empty        | Error message in alert window  |\r\n      | Valid code   | displayed in the console       |\r\n      | Invalid code | nameerror pop up alert message |\r\n\r\n  @Queue10\r\n  Scenario: Verify that user is able to navigate to \"Practice Questions\" Page for \"Implementation using collections.deque\" page\r\n    Given The user is on the tryEditor window in queue page\r\n    When The user clicks Practice Questions button following browser back arrow\r\n    Then The user is navigated to Practice Questions page\r\n\r\n  @Queue11\r\n  Scenario: Verify that user is able to navigate to \"Queue\" data structure page\r\n    Given The user is in the blank Practice page\r\n    When The user select Queue item from the drop down menu\r\n    Then The user is redirected to Queue Data Structure Page\r\n\r\n  @Queue12\r\n  Scenario: Verify that user is able to navigate to \"Implementation using array\" page\r\n    Given The user is in the Queue page after Sign in\r\n    When The user clicks Implementation using array button\r\n    Then The user should be redirected to Implementation using array page\r\n\r\n  @Queue13\r\n  Scenario: Verify that user is able to navigate to \"try Editor\" page for \"Implementation using array\" page\r\n    Given The user is on the Implementation using array page\r\n    When The user clicks Try Here>>> button\r\n    Then Navigate to try Editor window with a Run button to test\r\n\r\n  @Queue14\r\n  Scenario Outline: Verify TryEditor functionality for  \"Implementation using array\" page\r\n    Given The user is on the tryEditor window in queue page\r\n    When The user enters the <code> in text editor and clicks RUN Button\r\n    Then The <alert> should be displayed\r\n\r\n    Examples: \r\n      | code         | alert                          |\r\n      | Empty        | Error message in alert window  |\r\n      | Valid code   | displayed in the console       |\r\n      | Invalid code | nameerror pop up alert message |\r\n\r\n  @Queue15\r\n  Scenario: Verify that user is able to navigate to \"Practice Questions\" Page for \"Implementation using array\" page\r\n    Given The user is on the tryEditor window in queue page\r\n    When The user clicks Practice Questions button following browser back arrow\r\n    Then The user is navigated to Practice Questions page\r\n\r\n  @Queue16\r\n  Scenario: Verify that user is able to navigate to \"Queue\" data structure page\r\n    Given The user is in the blank Practice page\r\n    When The user select Queue item from the drop down menu\r\n    Then The user is redirected to Queue Data Structure Page\r\n\r\n  @Queue17\r\n  Scenario: Verify that user is able to navigate to \"Queue Operations\" page\r\n    Given The user is in the Queue page after Sign in\r\n    When The user clicks Queue Operations button\r\n    Then The user should be redirected to Queue Operations page\r\n\r\n  @Queue18\r\n  Scenario: Verify that user is able to navigate to \"try Editor\" page for \"Queue Operations\" page\r\n    Given The user is on the Queue Operations page\r\n    When The user clicks Try Here>>> button\r\n    Then Navigate to try Editor window with a Run button to test\r\n\r\n  @Queue19\r\n  Scenario Outline: Verify TryEditor functionality for  \"Queue Operations\" page\r\n    Given The user is on the tryEditor window in queue page\r\n    When The user enters the <code> in text editor and clicks RUN Button\r\n    Then The <alert> should be displayed\r\n\r\n    Examples: \r\n      | code         | alert                          |\r\n      | Empty        | Error message in alert window  |\r\n      | Valid code   | displayed in the console       |\r\n      | Invalid code | nameerror pop up alert message |\r\n\r\n  @Queue20\r\n  Scenario: Verify that user is able to navigate to \"Practice Questions\" Page for \"Queue Operations\" page\r\n    Given The user is on the tryEditor window in queue page\r\n    When The user clicks Practice Questions button following browser back arrow\r\n    Then The user is navigated to Practice Questions page\r\n\r\n  @Queue21\r\n  Scenario: Verify that user is able to navigate to \"Queue\" data structure page\r\n    Given The user is in the blank Practice page\r\n    When The user select Queue item from the drop down menu\r\n    Then The user is redirected to Queue Data Structure Page\r\n\r\n  @Queue22\r\n  Scenario: Verify that user able to sign out successfully\r\n    Given The user is in the Queue page\r\n    When The user clicks Sign out\r\n    Then The user should be redirected to home page with message Logged out successfully","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/bhoom\/eclipse-workspace\/NetworkNinjasBDD_DsAlgo\/src\/test\/resources\/features\/Queue.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@overall","id":"c5982a2c-ed95-40a5-abbc-488291c17d32"}],"language":"en","keyword":"Feature","name":"Testing Queue feature in DSPortal app","description":"  User will be able to understand different topics and try python code","children":[{"scenario":{"location":{"line":6,"column":3},"tags":[{"location":{"line":5,"column":3},"name":"@Queue1","id":"b586dacf-6955-4cee-9d81-7de657ebc29c"}],"keyword":"Scenario","name":"Verify that user is able to navigate to \"Queue\" data structure page","description":"","steps":[{"location":{"line":7,"column":5},"keyword":"Given ","keywordType":"Context","text":"The user is in the urces\/features\/Queue.feature","name":"Verify that user able to sign out successfully","language":"en","steps":[{"astNodeIds":["e89dadda-305d-4e5d-8c0d-f9569f621fad"],"id":"08b1eb62-f1c8-417d-b61f-9c1143c75351","type":"Context","text":"The user is in the Queue page"},{"astNodeIds":["03cdef71-9921-496e-82f4-b44a4dcdaa5e"],"id":"95cdcf54-0588-4af6-9874-57d0a5153385","type":"Action","text":"The user clicks Sign out"},{"astNodeIds":["2f3e003c-6911-496d-97b2-b8685b7d7aab"],"id":"e94c408b-a6e6-4ed1-a168-4a98a535c7a0","type":"Outcome","text":"The user should be redirected to home page with message Logged out successfully"}],"tags":[{"name":"@overall","astNodeId":"c5982a2c-ed95-40a5-abbc-488291c17d32"},{"name":"@Queue22","astNodeId":"3ea2ac3e-8e99-4cb3-8e49-fc5692fbfbe7"}],"astNodeIds":["dd33cdf1-76d7-4af4-b992-7135c6ccded8"]}},{"source":{"uri":"file:\/\/\/C:\/Users\/bhoom\/eclipse-workspace\/NetworkNinjasBDD_DsAlgo\/src\/test\/resources\/features\/Register.feature","data":"@overall\r\nFeature: Register page features\r\n  I want to use this template for my feature file\r\n\r\n  @Reg1\r\n  Scenario: Verify that user is able to navigate to \"home\"  page\r\n    Given The user is on the ds portal  page\r\n    When The user clicks get started on the Home page\r\n    Then The user should be redirected to home page\r\n\r\n  @Reg2\r\n  Scenario: Verify that user is able to navigate to \"Register\"  page\r\n    Given The user is on the ds portal home page\r\n    When The user clicks Register link on the Home page\r\n    Then The user should be redirected to Register page\r\n\r\n  @Reg3\r\n  Scenario: Verify that user receives error message for all empty fields during registration\r\n    Given The user is on the user registration page\r\n    When The user clicks Register button with all fields empty\r\n    Then The error \"Please fill out this field.\" appears below Username textbox\r\n\r\n  @Reg4\r\n  Scenario: Verify that user receives error message for empty Username field during registration\r\n    Given The user is on the user registration page\r\n    When The user clicks Register button without entering Username with all other fields filled\r\n    Then The error \"Please fill out this field.\" appears below Username textbox\r\n\r\n  @Reg5\r\n  Scenario: Verify that user receives error message for empty Password field during registration\r\n    Given The user is on the user registration page\r\n    When The user clicks Register button after entering Username with other fields empty\r\n    Then The error message \"Please fill out this field.\" appears below Password textbox\r\n\r\n  @Reg6\r\n  Scenario: Verify that user receives error message for empty Password Confirmation field during registration\r\n    Given The user is on the user registration page\r\n    When The user clicks Register button after entering Username and Password with Password Confirmation field empty\r\n    Then The error message \"Please fill out this field.\" appears below  Password Confirmation textbox\r\n\r\n  #@tag6\r\n  #Scenario: Verify that user receives error message for invalid username field during registration\r\n  #Given The user is on the user registration page\r\n  #When The user clicks Register button after entering a username with spacebar characters other than digits\r\n  #Then The user is not able to see error msg after entering invalid data\r\n  @Reg11\r\n  Scenario: Verify that user receives error message for invalid password field during registration\r\n  Given The user is on the user registration page\r\n  When The user clicks Register button after entering a password with numeric data\r\n  Then The user is able to see error msg after entering invalid data \"password_mismatch:The two password fields didn’t match.\"\r\n  @Reg7\r\n  Scenario: Verify that user receives error message for mismatched Password and Password Confirmation field during registration\r\n    Given The user is on the user registration page\r\n    When The user clicks Register button after entering different passwords in Password and Password Confirmation fields\r\n    Then The user should able to see an pwd warning message \"password_mismatch:The two password fields didn’t match.\"\r\n\r\n  @Reg8\r\n  Scenario: Verify that user receives error message for existing Username during registration\r\n    Given The user is on the user registration page\r\n    When The user clicks Register button after entering existing Username\r\n    Then The user is not able to see error msg \"username exists. Plz change username\" after entering existing username\r\n\r\n  @Reg9\r\n  Scenario: Verify that user receives error message for same Username and password during registration\r\n    Given The user is on the user registration page\r\n    When The user clicks Register button after entering same Username and password\r\n    Then The user is not able to see error msg \"same username and password. Plz change username\" after entering same Username and password\r\n\r\n  @Reg10\r\n  Scenario: Verify that user is able to land on Homepage after registration with valid fields\r\n    Given The user is on the user registration page\r\n    When The user clicks Register button after entering  with valid username, password and password confirmation in related textboxes\r\n    Then The user should be redirected to Home Page of DS Algo with message \"New Account Created. You are logged in\"\r\n    #@tagDemo\r\n  #Scenario Outline: Successful user registration\r\n    #Given The user is on the user registration page\r\n    #When The user clicks Register button after entering username <username>, password <password> and password confirmation <confirme password>\r\n    #Then The user should be redirected to Home Page of DS Algo with message New Account Created. You are logged in as <ID>\r\n  #\r\n   #Examples: \r\n      #| Username         | Password         \t| Password Confirmation \t\t\t\t| Action\r\n      #| Empty        \t\t|\tEmpty\t\t\t\t\t\t \t| Empty\t\t\t\t\t\t\t\t\t\t\t\t\t| Please fill out this field  \r\n      #| Valid Username   |\tValid Password  \t|\tMatchs with Password\t\t\t\t\t|\tNew Account Created. You are logged in as <ID>\r\n      #| Invalid Username |\tInvalid Password  | Mismatch with Password\t\t\t\t| Warrning msg:password_mismatch:The two password fields didn’t match.\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/bhoom\/eclipse-workspace\/NetworkNinjasBDD_DsAlgo\/src\/test\/resources\/features\/Register.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@overall","id":"cd244b8c-3f9b-456f-9afd-e38e1eea1b84"}],"language":"en","keyword":"Feature","name":"Register page features","description":"  I want to use this template for my feature file","children":[{"scenario":{"location":{"line":6,"column":3},"tags":[{"location":{"line":5,"column":3},"name":"@Reg1","id":"41b385f9-bf35-4f3d-a662-a50765f7089b"}],"keyword":"Scenario","name":"Verify that user is able to navigate to \"home\"  page","description":"","steps":[{"location":{"line":7,"column":5},"keyword":"Given ","keywordType":"Context","text":"The user is on the ds portal  page","id":"733dc549-deb1-4fb6-ac7c-7b93e9255016"},{"location":{"line":8,"column":5},"keyword":"When ","keywordType":"Action","text":"The user clicks get started on the Home page","id":"d94b2c5f-bb9d-4441-8937-953d8e75842e"},{"location":{"line":9,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"The user should be redirected to home page","id":"609853c9-f5a3-4b9e-b746-1f69f9ebee04"}],"examples":[],"id":"99b872e8-b4fd-4625-81b8-cf3b4c049680"}},{"scenario":{"location":{"line":12,"column":3},"tags":[{"location":{"line":11,"column":3},"name":"@Reg2","id":"da49cc16-457e-4235-b905-e82133c1d2f3"}],"keyword":"Scenario","name":"Verify that user is able to navigate to \"Register\"  page","description":"","steps":[{"location":{"line":13,"column":5},"keyword":"Given ","keywordType":"Cont  item from the drop down menu\n    Then The user is directed to Stack Data Structure Page\n\n  @stack2\n  Scenario: Navigate to \"Operations in Stack\" page\n    Given The user is in the Stack page after Sign in\n    When The user clicks Operations in Stack button\n    Then The user should be redirected to Operations in Stack page\n\n  @stack3\n  Scenario: Navigate to \"try Editor\" page for \"Operations in Stack\" page\n    Given The user is on the Operations in Stack page\n    When The user clicks Try Here>>> button\n    Then Navigate to try Editor window with a Run button to test\n\n  @stack4\n  Scenario Outline: TryEditor functionality for \"Operations in Stack\" page\n    Given The user is on the tryEditor window in Stack page\n    When The user enters the <code> in text editor and clicks RUN Button\n    Then The <alert> should be displayed\n\n    Examples: \n      | code         | alert                          |\n      | Empty        | Error message in alert window  |\n      | Valid code   | displayed in the console       |\n      | Invalid code | nameerror pop up alert message |\n\n  @stack5\n  Scenario: Navigate to \"Practice Questions\" Page for \"Operations in Stack\" page\n    Given The user is on the tryEditor window in Stack page\n    When The user clicks Practice Questions button following browser back arrow\n    Then The user is navigated to Practice Questions page\n\n  @stack6\n  Scenario: Navigate to \"Stack\" data structure page\n    Given The user is in the blank Practice page\n    When The user select Stack item from the drop down menu\n    Then The user is directed to Stack Data Structure Page\n\n  @stack7\n  Scenario: Navigate to \"Implementation\" page\n    Given The user is in the Stack page after Sign in\n    When The user clicks Implementation button\n    Then The user should be redirected to Implementation page\n\n  @stack8\n  Scenario: Navigate to \"try Editor\" page for \"Implementation\" page\n    Given The user is on the Implementation page\n    When The user clicks Try Here>>> button\n    Then Navigate to try Editor window with a Run button to test\n\n  @stack9\n  Scenario Outline: TryEditor functionality for \"Implementation\" page\n    Given The user is on the tryEditor window in Stack page\n    When The user enters the <code> in text editor and clicks RUN Button\n    Then The <alert> should be displayed\n\n    Examples: \n      | code         | alert                          |\n      | Empty        | Error message in alert window  |\n      | Valid code   | displayed in the console       |\n      | Invalid code | nameerror pop up alert message |\n\n  @stack10\n  Scenario: Navigate to \"Practice Questions\" Page for \"Implementation\" page\n    Given The user is on the tryEditor window in Stack page\n    When The user clicks Practice Questions button following browser back arrow\n    Then The user is navigated to Practice Questions page\n\n  @stack11\n  Scenario: Navigate to \"Stack\" data structure page\n    Given The user is in the blank Practice page\n    When The user select Stack item from the drop down menu\n    Then The user is directed to Stack Data Structure Page\n\n  @stack12\n  Scenario: Navigate to \"Applications\" page\n    Given The user is in the Stack page after Sign in\n    When The user clicks Applications button\n    Then The user should be redirected to Applications in Stack page\n\n  @stack13\n  Scenario: Navigate to \"try Editor\" page for \"Applications\" page\n    Given The user is on the Applications page\n    When The user clicks Try Here>>> button\n    Then Navigate to try Editor window with a Run button to test\n\n  @stack14\n  Scenario Outline: TryEditor functionality for \"Applications\" page\n    Given The user is on the tryEditor window in Stack page\n    When The user enters the <code> in text editor and clicks RUN Button\n    Then The <alert> should be displayed\n\n    Examples: \n      | code         | alert                          |\n      | Empty        | Error message in alert window  |\n      | Valid code   | displayed in the console       |\n      | Invalid code | nameerror pop up alert message |\n\n  @stack15\n  Scenario: Navigate to \"Practice Questions\" Page for \"Applications\" page\n    Given The user is on the tryEditor window in Stack page\n    When The user clicks Practice Questions button following browser back arrow\n    Then The user is navigated to Practice Questions page\n\n  @stack16\n  Scenario: Navigate to \"Stack\" data structure page\n    Given The user is in the blank Practice page\n    When The user select Stack item from the drop down menu\n    Then The user is directed to Stack Data Structure Page\n\n  @stack17\n  Scenario: Signout from Stacks page and navigated to Home page\n    Given The user is in the Stack page\n    When The user clicks Sign out\n    Then The user should be redirected to home page with message Logged out successfully\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/bhoom\/eclipse-workspace\/NetworkNinjasBDD_DsAlgo\/src\/test\/resources\/features\/stacks.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@overall","id":"ad387360-4955-45b2-abe4-578406be0a5c"}],"language":"en","keyword":"Feature","name":"Navigation and Functionality for Stacks in dsAlgo Portal","description":"","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[{"location":{"line":4,"column":3},"name":"@stack1","id":"3faa0c13-16cc-4b95-89fc-20a22b9676b7"}],"keyword":"Scenario","name":"Navigate to \"Stack\" data structure page","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"Given ","keywordType":"Context","text":"The user is in the Home page after Sign in","id":"b0e8c414-449c-4a89-a15a-41bb576b1c80"},{"location":{"line":7,"column":5},"keyword":"When ","keywordType":"Action","text":"The user clicks the Get Started button in Stack Panel or The user select Stack item from
